/*
 * @lc app=leetcode id=1695 lang=typescript
 *
 * [1695] Maximum Erasure Value
 */

// @lc code=start
function maximumUniqueSubarray(nums: number[]): number {
  const seen = new Set<number>();
  const { max } = Math;
  const len = nums.length;
  var mark = 0;
  var ans = 0;
  var lt = 0;
  var rt = 0;
  var ttl = 0;

  while (lt < len) {
    while (mark === 0 && rt < len) {
      const vr = nums[rt] as number;

      if (seen.has(vr)) {
        mark = vr;
        break;
      }
      seen.add(vr);
      ttl += vr;
      rt++;
    }
    const vl = nums[lt++]!;
    ans = max(ans, ttl);

    if (vl === mark) {
      mark = 0;
    }
    seen.delete(vl);
    ttl -= vl;
  }
  return ans;
}
